void imprime(int v) {

  char str[15];
  switch (v) {
  case AP:
    printf("(");
    break;
  case FP:
    printf(")");
    break;
  case K:

    printf("K");
    break;
  case S:
    printf("S");
    break;
  case app:
    printf("@");
    break;
  case fim_string:
    printf(";");
    break;
  default:
    printf("%d", v);
  }
}

void mostraArvore(Celula a, int b) {
  if (a == NULL)
    return;
  if (a->esq != NULL) {
    printf("[");
    mostraArvore(a->esq, b + 1);
    printf("] <- ");
  } else
    printf("(");
  imprime(a->tipo);
  if (a->dir != NULL) {
    printf(" -> [");
    mostraArvore(a->dir, b + 1);
    printf("]");
  } else
    printf(")");
}
Celula cria_celula(int tipo, Celula esq, Celula dir) {
  // printf("%d\n",tipo);
  heap[index_criacao].tipo = tipo;
  heap[index_criacao].esq = esq;
  heap[index_criacao].dir = dir;
  return &heap[index_criacao++];
}

void casa_parenteses(int *array1, int *n) {
  int c = *n;
  int p = 1;
  while (p != 0)
    switch (array1[c++]) {
    case AP:
      p++;
      break;
    case FP:
      p--;
    }
  *n = c;
}
void acha_argumento(int *array1, int *p) {
  if (array1[(*p)++] == AP)
    casa_parenteses(array1, p);
}

Celula cria_grafo(int *codigo) {
  int index = 0;
  int valor;
  Celula aux;
  pilha_p = 0;

  Celula atual = NULL;
  while (codigo[index] != fim_string) {
    valor = codigo[index];
    switch (valor) {
    case AP:
      pilha[pilha_p++] = atual;
      atual = cria_celula(app, NULL, NULL);
      break;
    case FP:
      if (pilha[pilha_p - 1] == NULL) {
        --pilha_p;
        break;
      }
      if (pilha[pilha_p - 1]->esq != NULL)
        pilha[pilha_p - 1]->esq = atual;
      else
        pilha[pilha_p - 1]->dir = atual;
      atual = pilha[--pilha_p];
      break;
    default:
      if (atual == NULL) {
        atual = cria_celula(codigo[index], NULL, NULL);
        break;
      }
      if (atual->tipo == app) {
        if (atual->esq == NULL) {
          atual->esq = cria_celula(codigo[index], NULL, NULL);
          break;
        } else if (atual->dir == NULL) {
          atual->dir = cria_celula(codigo[index], NULL, NULL);
          break;
        }
      }
      aux = cria_celula(app, atual, cria_celula(codigo[index], NULL, NULL));
      atual = aux;
      break;
    }
    ++index;
  }
  return atual;
}

