Celula inline reduz_k() {
  // K a b => a
  Celula a = pilha[--pilha_p]->dir;
  Celula b = pilha[--pilha_p]->dir;
  pilha[--pilha_p]->esq = a;
  return a;
}

Celula inline reduz_s() {
  // S a b c => a c ( b c )
  Celula a = pilha[--pilha_p]->dir;
  Celula b = pilha[--pilha_p]->dir;
  Celula c = pilha[--pilha_p]->dir;

  Celula Sesq = cria_celula(app, a, c);
  Celula Sdir = cria_celula(app, b, c);
  Celula Sroot = cria_celula(app, Sesq, Sdir);
  pilha_p -= 1;
  return Sroot;
}
Celula inline reduz_s1() {
  // S x a b c => x (a c ) ( b c )
  Celula x = pilha[pilha_p - 1]->dir;
  Celula a = pilha[pilha_p - 2]->dir;
  Celula b = pilha[pilha_p - 3]->dir;
  Celula c = pilha[pilha_p - 4]->dir;
  pilha[pilha_p - 4]->dir = cria_celula(app, b, c);
  pilha[pilha_p - 3]->dir = cria_celula(app, a, c);
  pilha[pilha_p - 3]->esq = x;
  return x;
}
Celula inline reduz_i() {
  // I a => a
  Celula a = pilha[pilha_p - 1]->dir;
  pilha[pilha_p - 2]->esq = a;
  --pilha_p;
  return a;
}
Celula inline reduz_b() {
  // B a b c => a (b c)
  Celula a = pilha[pilha_p - 1]->dir;
  Celula b = pilha[pilha_p - 2]->dir;
  Celula c = pilha[pilha_p - 3]->dir;

  pilha[pilha_p - 3]->dir = cria_celula(app, b, c);
  pilha[pilha_p - 3]->esq = a;
  pilha_p -= 2;
  return a;
}
Celula inline reduz_b1() {
  // B1 a b c d => a b( c d )
  Celula a = pilha[pilha_p - 1]->dir;
  Celula b = pilha[pilha_p - 2]->dir;
  Celula c = pilha[pilha_p - 3]->dir;
  Celula d = pilha[pilha_p - 4]->dir;
  pilha[pilha_p - 4]->dir = cria_celula(app, c, d);
  pilha[pilha_p - 3]->dir = b;
  pilha[pilha_p - 3]->esq = a;
  return a;
}
Celula inline reduz_c() {
  // C f g x => f x g
  Celula f = pilha[pilha_p - 1]->dir;
  Celula g = pilha[pilha_p - 2]->dir;
  Celula x = pilha[pilha_p - 3]->dir;
  pilha[pilha_p - 3]->dir = g;
  pilha[pilha_p - 2]->dir = x;
  pilha[pilha_p - 2]->esq = f;
  pilha_p -= 1;
  return f;
}
Celula inline reduz_Y() {
  // Y a => a ( Y a )
  Celula a = pilha[pilha_p - 1]->dir;
  Celula y = cria_celula(Y, NULL, NULL);
  pilha[pilha_p - 1]->dir = cria_celula(app, y, a);
  pilha[pilha_p - 1]->esq = a;
  return a;
}
Celula inline reduz_True() {
  // True a b => a
  Celula a = pilha[pilha_p - 1]->dir;
  Celula b = pilha[pilha_p - 2]->dir;
  pilha[pilha_p - 3]->esq = a;
  pilha_p -= 2;
  return a;
}
Celula inline reduz_False() {
  // False a b => b
  Celula a = pilha[pilha_p - 1]->dir;
  Celula b = pilha[pilha_p - 2]->dir;
  pilha[pilha_p - 3]->esq = b;
  pilha_p -= 2;
  return b;
}
void aplicar_reducao(Celula cell) {
  pilha_p = 0;
  Celula atual = cria_celula(app, cell, NULL), aux;
  mostraArvore(pilha[0], 0);
  printf("\n\n");
  pilha[pilha_p++] = atual;
  while (1) {
    if (atual->esq == NULL) {
      switch (atual->tipo) {
      case K:
        atual = reduz_k();
        break;
      case S:
        atual = reduz_s();
        break;

      default:
        printf("\n\n\n\nend\n");
        mostraArvore(pilha[0], 0);
        return;
      }
    } else {
      aux = atual->esq;
      pilha[pilha_p++] = atual;
      atual = aux;
    }
  }
}

